import React from 'react';
//import './App.css';
//import { Link } from 'react-router-dom';
import store from '/store';


export const MainContainer = () => {
    return (
        <ul className='FolderList'>
            {store.map(folder => 
                <li key={folder.id}>
                    <Link to={`/folder/${folder.id}`}>
                        {folder.name}
                    </Link>
                </li>
            )}
        </ul>
    )
}
